// import Link from "next/link";
import React, { Component } from 'react';
import css from "./Navbar.css";
import NavLink from "./NavLink";

class Navbar extends Component {

    state = {
        showMobileDropDown: false

    }

    toggleMobileNav = () => {
        console.log("Mobile Nav")

        this.setState({
            showMobileDropDown: !this.state.showMobileDropDown
        })
    }

    render() {

        let that = this


   return (



// const Navbar = props => (
  <div className={css.OuterNavContainer}>
    <div className={`${css.navbar} ${css.regNav}`}>
      <NavLink name="About Us" url="page/about/" style={css.navLink} />
      <NavLink name="Portfolio" url="case-studies/" style={css.navLink}/>
      <NavLink name="What We Do" url="#what-we-do" style={css.navLink}/>
      <NavLink name="Who We Serve" url="#who-we-serve" style={css.navLink}/>
      <NavLink name="Contact Us" url="page/contact/" style={css.navLink}/>
      <img
        onClick = {this.toggleMobileNav}
        className={css.hamburgerMenu}
        src="https://labs.chiedo.com/wp-content/themes/chiedolabs/img/mob-trig.png"
        alt="Mobile menu hamburger icon"
        title="Mobile menu icon"
      />
    </div>
    <div className={`${css.mobileNav} ${that.state.showMobileDropDown ? css.showMobileDropDown : css.HideMobileDropDown}`}> 
    <NavLink name="About Us" url="page/about/" style={css.mobileNavLink} />
      <NavLink name="Portfolio" url="case-studies/" style={css.mobileNavLink}/>
      <NavLink name="What We Do" url="#what-we-do" style={css.mobileNavLink}/>
      <NavLink name="Who We Serve" url="#who-we-serve" style={css.mobileNavLink}/>
      <NavLink name="Contact Us" url="page/contact/" style={css.mobileNavLink}/>
    </div>
  </div>
)

}
}

export default Navbar;
